package com.dsalgo.queue;

public class CircularQueue {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n=50;
		for(int i=1; i<n; i++) {
//			//System.out.println(" i ==> "+i);
			for(int j=0;j*j <i; j++) {
				System.out.println("i ==> "+i+"j ==> "+j);
			}
			
		}
	}

}
